ReinforcementBendRules.r1:
Diámetro mínimo del mandril don para armadura se toma en función del diámetro de barra ds, no inferior a:
- para barras lisas
 don=2,5ds - ds< 20 mm;
don=4ds - ds ≥ 20 mm;
- para barras corrugadas 
 don=5ds - ds < 20 mm;
don=8ds - ds ≥ 20 mm;

ReinforcementBendRules.r2:
Diámetro mínimo del mandril para evitar daños a armadura es:
4Ø para un diámetro de barra Ø ≤ 16 mm;
7Ø para un diámetro de barra Ø > 16 mm;
